import React, { Component } from "react";

export default class Node extends Component {
    constructor(props) {
        super(props);
        this.state = {
            value: props.value,
            parent: props.parent,
            left: props.left,
            right: props.right,
            height: props.height,
            start: props.start,
            end: props.end
        };
    }
    render() {
        const nodeStyle = {
            height: "25px",
            width: "25px",
            gridColumnStart: this.state.start,
            gridColumnEnd: this.state.end,
        
            backgroundColor: "#fff",
            borderRadius: "50%",
            border: "2px solid red",
        
            display: "flex",
            justifyContent: "center",
            alignItems: "center"
        }

        return (
            <div style={nodeStyle}>
                {this.state.value}
            </div>
        );
    }
}
